declare const SQL_QUERY = "\nUPDATE OR IGNORE Person SET\n  \"id\" = IFNULL(@id, \"id\"), \"countyId\" = IFNULL(@countyId, \"countyId\"), \"affidavitNum\" = IFNULL(@affidavitNum, \"affidavitNum\"), \"precinct\" = IFNULL(@precinct, \"precinct\"), \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"preNominal\" = IFNULL(@preNominal, \"preNominal\"), \"firstName\" = IFNULL(@firstName, \"firstName\"), \"middleName\" = IFNULL(@middleName, \"middleName\"), \"lastName\" = IFNULL(@lastName, \"lastName\"), \"suffix\" = IFNULL(@suffix, \"suffix\"), \"postNominal\" = IFNULL(@postNominal, \"postNominal\"), \"nickname\" = IFNULL(@nickname, \"nickname\"), \"birthDate\" = IFNULL(@birthDate, \"birthDate\"), \"birthState\" = IFNULL(@birthState, \"birthState\"), \"birthCountry\" = IFNULL(@birthCountry, \"birthCountry\"), \"gender\" = IFNULL(@gender, \"gender\"), \"party\" = IFNULL(@party, \"party\"), \"ballot\" = IFNULL(@ballot, \"ballot\"), \"religion\" = IFNULL(@religion, \"religion\"), \"education\" = IFNULL(@education, \"education\"), \"military\" = IFNULL(@military, \"military\"), \"income\" = IFNULL(@income, \"income\"), \"primaryLanguageCode\" = IFNULL(@primaryLanguageCode, \"primaryLanguageCode\"), \"secondaryLanguageCode\" = IFNULL(@secondaryLanguageCode, \"secondaryLanguageCode\"), \"primaryEthnicityCode\" = IFNULL(@primaryEthnicityCode, \"primaryEthnicityCode\"), \"secondaryEthnicityCode\" = IFNULL(@secondaryEthnicityCode, \"secondaryEthnicityCode\")\nWHERE\n  \"id\" = @id\n";
